CREATE DEFINER=`root`@`localhost` PROCEDURE `CreateUsersForClubs` ()   BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE club_email VARCHAR(255);
    DECLARE club_id INT;

    -- Curseur pour parcourir les clubs
    DECLARE club_cursor CURSOR FOR
        SELECT id, email FROM clubs;

    -- Gestion des erreurs pour le curseur
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    -- Ouvrir le curseur
    OPEN club_cursor;

    read_loop: LOOP
        FETCH club_cursor INTO club_id, club_email;

        -- Si plus de données, sortir de la boucle
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Insérer un utilisateur dans la table `users`
        INSERT INTO users (club_id, email, password, role_id, active)
        VALUES (club_id, club_email, SHA2('123', 256), 2, 1);
    END LOOP;

    -- Fermer le curseur
    CLOSE club_cursor;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `UpdateCustomIdForClubs` ()   BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE club_id INT;
    DECLARE club_abreviation VARCHAR(255);
    DECLARE club_region VARCHAR(255);

    -- Curseur pour parcourir les clubs
    DECLARE club_cursor CURSOR FOR
        SELECT id, abreviation, region FROM clubs;

    -- Gestion des erreurs pour le curseur
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    -- Ouvrir le curseur
    OPEN club_cursor;

    read_loop: LOOP
        FETCH club_cursor INTO club_id, club_abreviation, club_region;

        -- Si plus de données, sortir de la boucle
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Générer la première lettre de la région
        SET club_region = UPPER(SUBSTRING(club_region, 1, 1));

        -- Créer le custom_id
        SET @custom_id = CONCAT(club_abreviation, '-', club_region, '-', LPAD(club_id, 3, '0'));

        -- Mettre à jour la table `clubs` avec le custom_id
        UPDATE clubs
        SET custom_id = @custom_id
        WHERE id = club_id;
    END LOOP;

    -- Fermer le curseur
    CLOSE club_cursor;
END$$

DELIMITER ;

