INSERT INTO `blogs` (`id`, `image`, `description`, `tag`, `title`, `content`, `user_id`, `created_at`, `updated_at`, `blog_hash`) VALUES
(113, '/admin/uploads/images/blogs/1733912257.jpeg', '', NULL, 'Guide Pratique pour Plonger au Maroc : Instructions et Conseils', NULL, 202, '2024-12-11 09:17:37', '2024-12-11 09:17:37', 'b0ae4af4feceec41c3f3f54cc092c8a8'),
(114, '/admin/uploads/images/blogs/1733912662.jpeg', '', NULL, 'Convention de coopération et de collaboration à été signée entre l’Agence Marocaine Antidopage et la Fédération Royale Marocaine de Plongée et activités subaquatiques', '<p data-pm-slice=\"0 0 []\">Une convention de coop&eacute;ration et de collaboration &agrave; &eacute;t&eacute; sign&eacute;e le jeudi 18 mai 2022 entre l&rsquo;Agence Marocaine Antidopage et la F&eacute;d&eacute;ration Royale Marocaine de Plong&eacute;e et activit&eacute;s subaquatiques. Cette convention vient renforcer les actions de partenariat entreprises par l&rsquo;AMAD pour lutter efficacement contre le dopage dans le sport.</p>', 202, '2024-12-11 09:24:22', '2024-12-11 09:26:35', '483c652e273712f335427250bf429ee9'),
(115, '/admin/uploads/images/blogs/1733913290.png', '', NULL, 'Le président de la FRMPAS, Abdelaziz Al Azrak, élu à la tête de la confédération africaine des activités subaquatiques', '<p data-pm-slice=\"0 0 []\">Les dirigeants sportifs marocains ont &eacute;t&eacute;, une fois encore, &agrave; l&rsquo;honneur lors de la tenue, r&eacute;cemment en &Eacute;gypte, de l&rsquo;assembl&eacute;e g&eacute;n&eacute;rale de la Conf&eacute;d&eacute;ration mondiale des activit&eacute;s subaquatiques (CMAS) . Comme en football, deux Marocains ont &eacute;t&eacute; &eacute;lus &agrave; la t&ecirc;te de la Conf&eacute;d&eacute;ration africaine des activit&eacute;s subaquatiques.</p>\r\n<p data-pm-slice=\"0 0 []\">C&rsquo;est ainsi que le pr&eacute;sident de la f&eacute;d&eacute;ration royale marocaine de plong&eacute;e et activit&eacute;s subaquatiques (FRMPAS), Abdelaziz Al Azrak, a &eacute;t&eacute; &eacute;lu pr&eacute;sident de cette conf&eacute;d&eacute;ration. Et pour boucler la boucle, le secr&eacute;taire g&eacute;n&eacute;ral de la FRMPAS, Benzouina Brahim, a &eacute;t&eacute; &eacute;lu &agrave; la m&ecirc;me fonction au sein de cette m&ecirc;me instance. Une perc&eacute;e qui d&eacute;montre combien les dirigeants de la FRMPAS jouissent d&rsquo;une excellente r&eacute;putation au sein de la conf&eacute;d&eacute;ration mondiale des activit&eacute;s subaquatiques. Comme le dit le pr&eacute;sident Al Azrak: &laquo; Comme toujours, on travaille discr&egrave;tement pour renforcer notre pr&eacute;sence aux niveaux continental et mondial &raquo;. Bonne route ou plut&ocirc;t bonne plong&eacute;e sous-marine !</p>', 202, '2024-12-11 09:34:50', '2024-12-11 09:36:14', '8de96d1aec5a0fcb86b74546f01f09a3'),
(116, '/admin/uploads/images/blogs/1733913602.jpeg', '', NULL, 'Coupe du trône de nage avec palmes en eau libre : le club de l’ASAMIN remporte le titre', '<p data-pm-slice=\"0 0 []\">El Jadida - Le club Amal Inzegane de natation (ASAMIN) a remport&eacute; la coupe du tr&ocirc;ne 2023-2024 &agrave; l\'issue des comp&eacute;titions de nage avec palmes en eau libre organis&eacute;es samedi &agrave; El Jadida par la F&eacute;d&eacute;ration Royale Marocaine de Plong&eacute;e et d&rsquo;Activit&eacute;s Subaquatiques (FRMPAS).</p>\r\n<p data-pm-slice=\"0 0 []\">Le club s&rsquo;est impos&eacute; avec un score de 723 points, 245 points pour les nageuses et 478 points pour les nageurs, suivi par l&rsquo;association de plong&eacute;e d&rsquo;El Jadida avec un total de 529 points, 360 points pour les nageuses et 169 pour les nageurs et du Raja de Casablanca qui a totalis&eacute; 483 points, 347 points et 136 points. Dans la cat&eacute;gorie f&eacute;minine - individuel, la nageuse A&iuml;cha El Bekkali du Raja de Casablanca s&rsquo;est impos&eacute;e devant Hajar Moubal de l&rsquo;ASAMIN et en troisi&egrave;me position Soufia Garnoussi du Raja de Casablanca. Pour la cat&eacute;gorie masculine - individuel, Yahya El Azzaoui (Raja de Casablanca) a d&eacute;croch&eacute; la premi&egrave;re place suivi par Anas Amjoud de l&rsquo;ASAMIN et de Tajeddine Larhlimi du club de l&rsquo;association nationale de plong&eacute;e de Casablanca. Dans une d&eacute;claration &agrave; la MAP, le pr&eacute;sident du comit&eacute; technique de la FRMPAS, Hamza Timoyass a relev&eacute; qu&rsquo;il n&rsquo;existe pas une grande diff&eacute;rence entre les performances r&eacute;alis&eacute;es par les nageurs et les nageuses en lice, au total 120 repr&eacute;sentant des clubs affili&eacute;s &agrave; la f&eacute;d&eacute;ration et bas&eacute;s &agrave; Casablanca, K&eacute;nitra, Safi, Agadir, Inzegane, El Jadida, Marrakech et T&eacute;touan.</p>', 202, '2024-12-11 09:40:02', '2024-12-11 09:40:02', '5abaf3e7c3bdbc79e4c00b91256d4050'),
(117, '/admin/uploads/images/blogs/1733913741.jpeg', '', NULL, 'Compétition marocaine de plongée de 2024', '<p data-pm-slice=\"1 1 []\">La comp&eacute;tition marocaine de plong&eacute;e de 2024, qui s\'est tenue les 26 et 27 octobre, a offert un spectacle impressionnant, rassemblant des plongeurs talentueux venus de tout le pays. Apr&egrave;s une s&eacute;rie d&rsquo;&eacute;preuves techniques et d\'endurance, le club ASAMIN a d&eacute;croch&eacute; la premi&egrave;re place, marquant sa sup&eacute;riorit&eacute; dans le domaine de la plong&eacute;e au Maroc. Ce succ&egrave;s t&eacute;moigne de l\'engagement et du niveau de pr&eacute;paration des membres du club, consolidant ASAMIN comme l\'un des leaders dans la communaut&eacute; marocaine de plong&eacute;e.</p>', 202, '2024-12-11 09:42:21', '2024-12-11 09:42:21', '5cd1c2be0065503170cc2c6df22926cf');
