(118, '/admin/uploads/images/blogs/1733914362.jpeg', '', NULL, 'SONARGES لقاء رئيس شركة سونرجيس', '<p data-pm-slice=\"0 0 []\">. عُقد لقاء مثمر بين رئيس الجامعة الملكية المغربية للغوص والأنشطة تحت المائية وممثل شركة *سونرجيس*، حيث تم التطرق إلى مجموعة من القضايا ذات الأهمية المشتركة. تناول النقاش محاور استراتيجية تهدف إلى تعزيز التعاون بين الجانبين، مع التركيز على تطوير الأنشطة البحرية و دعم الغوص الرياض</p>\n<p data-pm-slice=\"0 0 []\">. شهد الاجتماع تبادلًا بنّاءً للأفكار والرؤى، ما ساهم في رسم معالم خطة عمل مستقبلية قائمة على شراكة فعّالة تخدم الأهداف المشتركة. وقد انتهى اللقاء بنتائج إيجابية عكس إرادة الطرفين للعمل سوياً من أجل تحقيق تطلعاتهما وتعزيز مكانة هذا القطاع في المغرب</p>\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1.2em; color: #598aa4; font-family: Poppins, sans-serif; font-size: 16px; background-color: #eef3f5;\"><img style=\"box-sizing: border-box; vertical-align: middle; border-style: none; height: auto; max-width: 100%; width: 1280px;\" src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2024-11-27 at 11.08.33 (1).jpeg\" /></p>\n<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1.2em; color: #598aa4; font-family: Poppins, sans-serif; font-size: 16px; background-color: #eef3f5;\"><img style=\"box-sizing: border-box; vertical-align: middle; border-style: none; height: auto; max-width: 100%; width: 1280px;\" src=\"data:image/jpeg;base64,\" data-filename=\"WhatsApp Image 2024-11-27 at 11.08.33.jpeg\" /></p>\n<p>&nbsp;</p>\n<p><img src=\"c:\\Users\\Administrator\\Downloads\\WhatsApp Image 2024-11-27 at 11.08.33 (1).jpeg\" alt=\"\" /></p>', 202, '2024-12-11 09:52:42', '2024-12-11 09:58:08', '67b454e327c108a153b0568023b4250c');

